import React, {useEffect, useState} from "react"
import Card from 'react-bootstrap/Card'
import CardDeck from 'react-bootstrap/CardDeck'
import eggTart from './portuguese-egg-custard-tarts.jpg'
import 'bootstrap/dist/css/bootstrap.min.css'
import database from '../firebase';
import "./Home.css";
import LoaddCards from './CustomCards'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
//import Cart from "./Cart"

function Home() {
  const [firestoreArray, setFirestoreArray] = useState([]);
  
  const db = database.firestore();
  const id = "user2@gmail.com";

  useEffect(() => {
        
    db.collection("FoodCollection").doc(id).collection("food").get().then(querySnapshot => {
        const data = querySnapshot.docs.map(doc => doc.data());
        console.log(data);
        setFirestoreArray(data);
    })

}, [])

  return (
    <div className="Home">
      {/*<Cart />*/}
      <div className="lander">
        <h1>ComfyBake</h1>
      </div>
      <div className="content">
        <Container>
          <Row>
          <CardDeck>
            <Card>
            {firestoreArray.map(each => <LoadCards key={each.Foodname}
                                              
              title= {each.Foodname}
              imageURL= {each.ImageUrl}
              body= {each.Body}
              price= {each.Price}
              ingredients= {each.Ingredients}
              />
            )}
            </Card>
            {/* <Card></Card>
            <Card></Card> */}
          </CardDeck>
            {/* <Col xs={6} md={4}>
              
            </Col>
            <Col xs={6} md={4}>
              xs=6 md=4
            </Col>
            <Col xs={6} md={4}>
              xs=6 md=4
            </Col> */}
          </Row>
          <CardDeck>
            <Card>
            {firestoreArray.map(each => <CustomCards key={each.Foodname}
                                              
              title= {each.Foodname}
              imageURL= {each.ImageUrl}
              body= {each.Body}
              price= {each.Price}
              ingredients= {each.Ingredients}
              />
            )}
            </Card>
            {/* <Card></Card>
            <Card></Card> */}
          </CardDeck>
        </Container>
        <CardDeck>
          <Card>
            <Card.Img variant="top" src = {eggTart} alt = "Portugese Egg Tarts" />
            <Card.Body>
              <Card.Title>Portugese Egg Tarts</Card.Title>
              <Card.Text>
                Portuguese egg tart: its crisp, flaky crust holding a creamy custard 
                center, blistered on top from the high heat of an oven.
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <p>$2.00</p>
              <small className="text-muted">Eggs | Milk</small>
            </Card.Footer>
          </Card>
          <Card>
            <Card.Img variant="top" src="https://dominosugar.com/emshare/views/modules/asset/downloads/originals/2020/09/74014/MuffinsTipsShippingBakedGoods.jpg/MuffinsTipsShippingBakedGoods.jpg" />
            <Card.Body>
              <Card.Title>Muffins</Card.Title>
              <Card.Text>
                Half-baked, delicious corn-meal, delicate crisp muffins
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <p>$1.50</p>
              <small className="text-muted">Eggs</small>
            </Card.Footer>
          </Card>
          <Card>
            <Card.Img variant="top" src="https://www.seriouseats.com/images/20100414-ph-macarons.jpg" />
            <Card.Body>
              <Card.Title>Macarons</Card.Title>
              <Card.Text>
                Butter-creamed filled cookie sandwich that transport 
                you to a cobbled street in Paris with one taste.
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <p>$3.00</p>
              <small className="text-muted">Eggs | Almond | Milk</small>
            </Card.Footer>
          </Card>
        </CardDeck>
      </div>
    </div>
  );
}

export default Home
